window.bookSummaryJSON = "<p><b>Book 4 of the Quint Adler Series </b></p> <p><b>(Can be listened to as a stand-alone, but Book 1 is </b><b><i>Revenge at Sea</i></b><b> if you'd rather start there.)</b></p> <p>Quint heads to Las Vegas and starts investigating the disappearance of Emmy Peters, a gorgeous 22-year-old showgirl.</p> <p>There are zero suspects and a scarcity of evidence. It's as if Emmy vanished into thin air.</p> <p>Quint remains determined, his investigation leading to gorgeous women, gambling, big-time casinos, and other Sin City trademarks. And yet, he's making very little progress.<br> <br> But then he gets a text that changes everything. Someone claims they know where Emmy is buried.</p> <p><b><i>Nine Days in Vegas</i></b> is the wildest and most shocking case of Quint's young career.</p>"; 
